import React from 'react';
import './Labels.css';
import noticiasImg from '../icons/labels-newspaper.svg';

function Labels() {
    return (
      <>
          <div className='labels'>
              <div className='labels-container'>
                  <ul className='labels-menu'>

                      <li className='labels-item'>
                          {/* <img src={noticiasImg} alt='notícias' /> */}
                          {/* <p className='label-title'>Notícias</p> */}
                          {/* <img src={} /> */}
                          {/* <p className='labels-txt'>Encontre Notícias pertinentes à UFU - Campus Patos de Minas e seus Cursos.</p> */}
                      </li>

                  </ul>
              </div>
          </div>
      </>
    );
  }

export default Labels;
